@pitbull81ff - Om det inte är ok att rippa en dvdr så skulle det ju överhuvud taget inte finnas några dvdrip, eller hur. 

Man frågar ju sig varför du egentligen skriver din kommentar, för det är väl ändå så inte p.g.a. att du tillhör samma sida som personen du hänvisar till va? ;)

Bättring i dina kommentarer tack. ;)
